import React from 'react';
import Nav from './component/Nav/Nav'
import Main from './Pages/Main'
import { BrowserRouter as Router, Switch,Route} from 'react-router-dom'

function App() {
  return (
     <Router>
        <Nav />
         <Route path='/main'>
         < Main/>
         </Route>
     </Router>
  );
}

export default App;
